      console.log(erro)
    })

},[])

function print() {
  if(data!=null)
  {
   return data.map((item)=>{
      console.log(item);
        return (<Product name={item.product_name} image={item.image}/>)
    })
  }

}

  return (
    <div className="App">
    <TitleHeader/>
    <div className="container">
    <div className="row">
      {
      print()
      }
      <AddProduct/>

      </div>

    </div>

    </div>
  );
}

export default App;
